import React, { Component } from 'react';
class Home extends Component {
  render() {
    return (
      <div className="Home"
      style={{
        display: 'flex',
        justifyContent: 'Right',
        alignItems: 'Right',
        height: '100vh'
      }}>
        This is the homepage.
      </div>
      
    )
  }
}
export default Home;
